import React from "react";
import { Container } from "./styles/SectionTWStyle";
const SectionTwo = () => {
    return (
        <Container>
            <h2>Expêriencia</h2>
            <p>Sem qualquer experiência na área de programação.</p>
            <p>Esta é uma aplicação feita apenas com a biblioteca ReactJs, foco em abrangir meus conhecimentos para ir ao mercado de trabalho como estagiário </p>
        </Container>
    );
};

export default SectionTwo;
